    public function init(): self
    {

        $this->variables = collect(['invoices', 'quotes', 'credits', 'purchase_orders'])->map(function ($type) {
            return $this->createVariables($type);
        })->toArray();

        $this->engines = [
            'invoices' => json_decode($this->invoice_data, true),
            'quotes' => json_decode($this->quote_data, true),
            'credits' => json_decode($this->credit_data, true),
            'tasks' => json_decode($this->task_data, true),
            'projects' => json_decode($this->project_data, true),
            'payments' => json_decode($this->payment_data, true),
            'purchase_orders' => json_decode($this->purchase_order_data, true),
        ];

        return $this;
            
    }

    /**
     * ['entity_type','design','settings_type','settings']
     *
     * @param string $type
     * @return array
     */
    private function createVariables(string $type): array
    {   
        $data = [
            'entity_type' => rtrim($type,"s"),
            'design' => '',
            'settings_type' => 'company',
            'settings' => $this->company->settings,
        ];

        $mock = (new PdfMock($data, $this->company));
        $mock->settings = $this->company->settings;
        $mock->build();

        return [$type => $mock->getStubVariables()];
    }

